INSERT INTO `tblemailtemplates` (`emailtemplateid`, `type`, `slug`, `language`, `name`, `subject`, `message`, `fromname`, `fromemail`, `plaintext`, `active`, `order`) VALUES
(1, 'client', 'new-client-created', 'english', 'New Contact Added/Registered (Welcome Email)', 'Bienvenido a IQneting CRM', '<span style=\"vertical-align: inherit;\">Estimado {contact_firstname} {contact_lastname} </span><br /><br /><span style=\"vertical-align: inherit;\">Gracias por ser parte del CRM de </span><strong><span style=\"vertical-align: inherit;\">{companyname} . </span></strong><span style=\"vertical-align: inherit;\"></span><br /><br /><span style=\"vertical-align: inherit;\">Queremos darte la bienvenida a nuestro portal, donde puedes ver el seguimiento de Pagos, Facturas y Avances de tu Proyecto, as&iacute; como tener acceso a nuestra mesa de control de soporte t&eacute;cnico.</span><br /><br /><span style=\"vertical-align: inherit;\">P&oacute;ngase en contacto con nosotros si necesita ayuda. </span><br /><br /><span style=\"vertical-align: inherit;\">Haga clic aqu&iacute; para ver su perfil: </span><a href=\"{crm_url}\"><span style=\"vertical-align: inherit;\">{crm_url}</span></a><br /><br /><span style=\"vertical-align: inherit;\"> Saludos cordiales, </span><br /><span style=\"vertical-align: inherit;\">{email_signature} </span><br /><br /><span style=\"vertical-align: inherit;\">(Este es un correo electr&oacute;nico autom&aacute;tico, as&iacute; que no responda a esta direcci&oacute;n de correo electr&oacute;nico)</span>', '{companyname} | CRM', '', 0, 1, 0),
(2, 'invoice', 'invoice-send-to-client', 'english', 'Send Invoice to Customer', 'Factura con numero {invoice_number} created', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Estimado {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hemos preparado la siguiente factura para usted: </span><strong><span style=\"vertical-align: inherit;\"># {invoice_number} Estado de la </span></strong></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">factura</span></strong><span style=\"vertical-align: inherit;\"> : {invoice_status} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puede ver la factura en el siguiente enlace: </span><a href=\"{invoice_link}\"><span style=\"vertical-align: inherit;\">{invoice_number}</span></a></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Cont&aacute;ctenos para obtener m&aacute;s informaci&oacute;n. </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Saludos cordiales, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(3, 'ticket', 'new-ticket-opened-admin', 'english', 'New Ticket Opened (Opened by Staff, Sent to Customer)', 'Nuevo Ticket de Soporte Abierto', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Se ha abierto un nuevo ticket de soporte. </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Asunto:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_subject} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Departamento:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_department} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Prioridad:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_priority} </span><br /></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Mensaje del ticket:</span></strong></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> {ticket_message} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puede ver el ticket en el siguiente enlace: </span><a href=\"{ticket_public_url}\"><span style=\"vertical-align: inherit;\">#{ticket_id}</span></a><br /><br /><span style=\"vertical-align: inherit;\">Atentamente, </span><br /><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', 'IQneting | CRM', '', 0, 1, 0),
(4, 'ticket', 'ticket-reply', 'english', 'Ticket Reply (Sent to Customer)', 'Nueva Respuesta de Ticket', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola, {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Tienes una nueva respuesta de ticket para el ticket </span><a href=\"{ticket_public_url}\"><span style=\"vertical-align: inherit;\">n.&ordm; {ticket_id} </span></a></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Asunto del ticket:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_subject} </span><br /></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Mensaje del ticket:</span></strong></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> {ticket_message} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puedes ver el ticket en el siguiente enlace: </span><a href=\"{ticket_public_url}\"><span style=\"vertical-align: inherit;\">#{ticket_id}</span></a></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Atentamente, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature }</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(5, 'ticket', 'ticket-autoresponse', 'english', 'New Ticket Opened - Autoresponse', 'Nuevo ticket de soporte abierto', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Gracias por contactar a nuestro equipo de soporte. Se ha abierto un ticket de soporte para su solicitud. Se le notificar&aacute; cuando se realice una respuesta por correo electr&oacute;nico. </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Asunto:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_subject} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Departamento</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_department} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Prioridad:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_priority} </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Mensaje del ticket:</span></strong></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> {ticket_message} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puede ver el ticket en el siguiente enlace: </span><a href=\"{ticket_public_url}\"><span style=\"vertical-align: inherit;\">#{ticket_id}</span></a></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Atentamente, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(6, 'invoice', 'invoice-payment-recorded', 'english', 'Invoice Payment Recorded (Sent to Customer)', 'Pago de factura registrado', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola {contact_firstname} {contact_lastname}</span><br /><br /></span><span style=\"vertical-align: inherit;\"> Gracias por el pago. Encuentre los detalles de pago a continuaci&oacute;n: </span><br /><br /><span style=\"vertical-align: inherit;\">-------------------------------------------- ----- </span><br /><br /><span style=\"vertical-align: inherit;\">Importe:&nbsp; </span><strong><span style=\"vertical-align: inherit;\">{total_pago}</span><br /></strong><span style=\"vertical-align: inherit;\"> Fecha:&nbsp; </span><strong><span style=\"vertical-align: inherit;\">{fecha_pago}</span></strong><br /><span style=\"vertical-align: inherit;\"> N&uacute;mero de factura:&nbsp; </span><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\"># {n&uacute;mero_factura}</span><br /><br /></strong></span><span style=\"vertical-align: inherit;\"> ---------------------------- --------------------- </span><br /><br /><span style=\"vertical-align: inherit;\">Siempre puede ver la factura de este pago en el siguiente enlace:&nbsp; </span><a href=\"{invoice_link}\"><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{invoice_number}</span></span></a><br /><br /><span style=\"vertical-align: inherit;\"> Esperamos trabajar con usted. </span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Saludos cordiales, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(7, 'invoice', 'invoice-overdue-notice', 'english', 'Invoice Overdue Notice', 'Aviso de factura vencida {invoice_number}', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola, {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Este es un aviso de vencimiento de la factura </span><strong><span style=\"vertical-align: inherit;\">n.&deg; {invoice_number}</span></strong></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Esta factura venci&oacute;: {invoice_duedate} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puede ver la factura en el siguiente enlace: </span><a href=\"{invoice_link}\"><span style=\"vertical-align: inherit;\">{invoice_number}</span></a></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Atentamente, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(8, 'invoice', 'invoice-already-send', 'english', 'Invoice Already Sent to Customer', 'Factura # {invoice_number} ', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola, {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">A pedido suyo, aqu&iacute; est&aacute; la factura con el n&uacute;mero </span><strong><span style=\"vertical-align: inherit;\"># {invoice_number}</span></strong></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Puede ver la factura en el siguiente enlace: </span><a href=\"{invoice_link}\"><span style=\"vertical-align: inherit;\">{invoice_number}</span></a></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Cont&aacute;ctenos para obtener m&aacute;s informaci&oacute;n. </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Saludos cordiales, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(9, 'ticket', 'new-ticket-created-staff', 'english', 'New Ticket Created (Opened by Customer, Sent to Staff Members)', 'Nuevo Ticket creado', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Se ha abierto un nuevo ticket de soporte. </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Asunto</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_subject} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Departamento</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_department} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Prioridad</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_priority} </span><br /></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Mensaje del ticket:</span></strong></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> {ticket_message} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puede ver el ticket en el siguiente enlace: </span><a href=\"{ticket_url}\"><span style=\"vertical-align: inherit;\">#{ticket_id}</span></a></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Atentamente, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(10, 'estimate', 'estimate-send-to-client', 'english', 'Send Estimate to Customer', 'Estimate # {estimate_number} created', '<span style=\"font-size: 12pt;\">Dear {contact_firstname} {contact_lastname}</span><br /><br /><span style=\"font-size: 12pt;\">Please find the attached estimate <strong># {estimate_number}</strong></span><br /><br /><span style=\"font-size: 12pt;\"><strong>Estimate status:</strong> {estimate_status}</span><br /><br /><span style=\"font-size: 12pt;\">You can view the estimate on the following link: <a href=\"{estimate_link}\">{estimate_number}</a></span><br /><br /><span style=\"font-size: 12pt;\">We look forward to your communication.</span><br /><br /><span style=\"font-size: 12pt;\">Kind Regards,</span><br /><span style=\"font-size: 12pt;\">{email_signature}<br /></span>', '{companyname} | CRM', '', 0, 1, 0),
(11, 'ticket', 'ticket-reply-to-admin', 'english', 'Ticket Reply (Sent to Staff)', ' Nueva respuesta de ticket de soporte', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Una nueva respuesta de ticket de soporte de {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Asunto</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_subject} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Departamento</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_department} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Prioridad</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_priority} </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Mensaje del ticket:</span></strong></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> {ticket_message} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Puede ver el ticket en el siguiente enlace: </span><a href=\"{ticket_url}\"><span style=\"vertical-align: inherit;\">#{ticket_id}</span></a></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\"> Atentamente, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{firma de email}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(12, 'estimate', 'estimate-already-send', 'english', 'Estimate Already Sent to Customer', 'Estimate # {estimate_number} ', '<span style=\"font-size: 12pt;\">Dear {contact_firstname} {contact_lastname}</span><br /> <br /><span style=\"font-size: 12pt;\">Thank you for your estimate request.</span><br /> <br /><span style=\"font-size: 12pt;\">You can view the estimate on the following link: <a href=\"{estimate_link}\">{estimate_number}</a></span><br /> <br /><span style=\"font-size: 12pt;\">Please contact us for more information.</span><br /> <br /><span style=\"font-size: 12pt;\">Kind Regards,</span><br /><span style=\"font-size: 12pt;\">{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0),
(13, 'contract', 'contract-expiration', 'english', 'Contract Expiration Reminder (Sent to Customer Contacts)', ' Recordatorio de vencimiento del contrato', '<span style=\"font-size:12pt;\"><span style=\"vertical-align:inherit;\">Estimado {client_company} </span></span><br><br><span style=\"font-size:12pt;\"><span style=\"vertical-align:inherit;\">Este es un recordatorio de que el siguiente contrato vencer&#225; pronto: </span></span><br><br><span style=\"font-size:12pt;\"><strong><span style=\"vertical-align:inherit;\">Asunto:</span></strong><span style=\"vertical-align:inherit;\"> {contract_subject} </span></span><br><span style=\"font-size:12pt;\"><strong><span style=\"vertical-align:inherit;\">Descripci&#243;n:</span></strong><span style=\"vertical-align:inherit;\"> {contract_description} </span></span><br><span style=\"font-size:12pt;\"><strong><span style=\"vertical-align:inherit;\">Fecha de inicio:</span></strong><span style=\"vertical-align:inherit;\"> {contract_datestart} </span></span><br><span style=\"font-size:12pt;\"><strong><span style=\"vertical-align:inherit;\">Fecha de finalizaci&#243;n:</span></strong><span style=\"vertical-align:inherit;\"> {contract_dateend} </span></span><br><br><span style=\"font-size:12pt;\"><span style=\"vertical-align:inherit;\">Comun&#237;quese con nosotros para obtener m&#225;s informaci&#243;n. </span></span><br><br><span style=\"font-size:12pt;\"><span style=\"vertical-align:inherit;\">Saludos cordiales, </span></span><br><span style=\"font-size:12pt;\"><span style=\"vertical-align:inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
(14, 'tasks', 'task-assigned', 'english', 'New Task Assigned (Sent to Staff)', 'New Task Assigned to You - {task_name}', '<span style=\"font-size: 12pt;\">Dear {staff_firstname}</span><br /><br /><span style=\"font-size: 12pt;\">You have been assigned to a new task:</span><br /><br /><span style=\"font-size: 12pt;\"><strong>Name:</strong> {task_name}<br /></span><strong>Start Date:</strong> {task_startdate}<br /><span style=\"font-size: 12pt;\"><strong>Due date:</strong> {task_duedate}</span><br /><span style=\"font-size: 12pt;\"><strong>Priority:</strong> {task_priority}<br /><br /></span><span style=\"font-size: 12pt;\"><span>You can view the task on the following link</span>: <a href=\"{task_link}\">{task_name}</a></span><br /><br /><span style=\"font-size: 12pt;\">Kind Regards,</span><br /><span style=\"font-size: 12pt;\">{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0),
(15, 'tasks', 'task-added-as-follower', 'english', 'Staff Member Added as Follower on Task (Sent to Staff)', 'You are added as follower on task - {task_name}', '<span style=\"font-size: 12pt;\">Hi {staff_firstname}<br /></span><br /><span style=\"font-size: 12pt;\">You have been added as follower on the following task:</span><br /><br /><span style=\"font-size: 12pt;\"><strong>Name:</strong> {task_name}</span><br /><span style=\"font-size: 12pt;\"><strong>Start date:</strong> {task_startdate}</span><br /><br /><span>You can view the task on the following link</span><span>: </span><a href=\"{task_link}\">{task_name}</a><br /><br /><span style=\"font-size: 12pt;\">Kind Regards,</span><br /><span style=\"font-size: 12pt;\">{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0),
(16, 'tasks', 'task-commented', 'english', 'New Comment on Task (Sent to Staff)', 'New Comment on Task - {task_name}', 'Dear {staff_firstname}<br /><br />A comment has been made on the following task:<br /><br /><strong>Name:</strong> {task_name}<br /><strong>Comment:</strong> {task_comment}<br /><br />You can view the task on the following link: <a href=\"{task_link}\">{task_name}</a><br /><br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0),
(17, 'tasks', 'task-added-attachment', 'english', 'New Attachment(s) on Task (Sent to Staff)', 'New Attachment on Task - {task_name}', 'Hi {staff_firstname}<br /><br /><strong>{task_user_take_action}</strong> added an attachment on the following task:<br /><br /><strong>Name:</strong> {task_name}<br /><br />You can view the task on the following link: <a href=\"{task_link}\">{task_name}</a><br /><br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0),
(18, 'estimate', 'estimate-declined-to-staff', 'english', 'Estimate Declined (Sent to Staff)', 'Customer Declined Estimate', '<span style=\"font-size: 12pt;\">Hi</span><br /> <br /><span style=\"font-size: 12pt;\">Customer ({client_company}) declined estimate with number <strong># {estimate_number}</strong></span><br /> <br /><span style=\"font-size: 12pt;\">You can view the estimate on the following link: <a href=\"{estimate_link}\">{estimate_number}</a></span><br /> <br /><span style=\"font-size: 12pt;\">{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0),
