(30, 'ticket', 'auto-close-ticket', 'english', 'Auto Close Ticket', ' Ticket Auto Cerrado', '<span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Hola, {contact_firstname} {contact_lastname} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">El ticket {ticket_subject} se cerr&oacute; autom&aacute;ticamente debido a la inactividad. </span></span><br /><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">N&uacute;mero de ticket</span></strong><span style=\"vertical-align: inherit;\"> : </span><a href=\"{ticket_public_url}\"><span style=\"vertical-align: inherit;\">{ticket_id} </span></a></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Departamento</span></strong><span style=\"vertical-align: inherit;\"> : {ticket_department} </span></span><br /><span style=\"font-size: 12pt;\"><strong><span style=\"vertical-align: inherit;\">Prioridad:</span></strong><span style=\"vertical-align: inherit;\"> {ticket_priority} </span></span><br /><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">Saludos amables, </span></span><br /><span style=\"font-size: 12pt;\"><span style=\"vertical-align: inherit;\">{email_signature}</span></span>', '{companyname} | CRM', '', 0, 1, 0),
