(40, 'staff', 'new-staff-created', 'english', 'New Staff Created (Welcome Email)', 'Está agregado como miembro del personal', '<span style=\"vertical-align: inherit;\">Hola {staff_firstname} </span><br /><br /><span style=\"vertical-align: inherit;\">Est&aacute;s agregado como miembro en nuestro CRM. </span><br /><br /><span style=\"vertical-align: inherit;\">Utilice las siguientes credenciales l&oacute;gicas: </span><br /><br /><strong><span style=\"vertical-align: inherit;\">Correo electr&oacute;nico:</span></strong><span style=\"vertical-align: inherit;\"> {staff_email} </span><br /><strong><span style=\"vertical-align: inherit;\">Contrase&ntilde;a:</span></strong><span style=\"vertical-align: inherit;\"> {contrase&ntilde;a} </span><br /><br /><span style=\"vertical-align: inherit;\">Haga clic </span><a href=\"{admin_url}\"><span style=\"vertical-align: inherit;\">aqu&iacute;</span></a><span style=\"vertical-align: inherit;\"> para iniciar sesi&oacute;n en el panel. </span><br /><br /><span style=\"vertical-align: inherit;\">Saludos cordiales, </span><br /><span style=\"vertical-align: inherit;\">{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0),
(41, 'client', 'contact-forgot-password', 'english', 'Forgot Password', 'Crear una nueva contraseña', '<h2><span style=\"vertical-align: inherit;\">Crear una nueva contrase&ntilde;a</span></h2>\r\n<span style=\"vertical-align: inherit;\">&iquest;Olvidaste tu contrase&ntilde;a? </span><br /><span style=\"vertical-align: inherit;\">Para crear una nueva contrase&ntilde;a, simplemente siga este enlace: </span><br /><br /><a href=\"{reset_password_url}\"><span style=\"vertical-align: inherit;\">Restablecer contrase&ntilde;a</span></a><br /><br /><span style=\"vertical-align: inherit;\"> Recibi&oacute; este correo electr&oacute;nico porque lo solicit&oacute; un usuario de {companyname}. Esto es parte del procedimiento para crear una nueva contrase&ntilde;a en el sistema. Si NO solicit&oacute; una nueva contrase&ntilde;a, ignore este correo electr&oacute;nico y su contrase&ntilde;a seguir&aacute; siendo la misma. </span><br /><br /><span style=\"vertical-align: inherit;\">{firma de email}</span>', '{companyname} | CRM', '', 0, 1, 0),
(42, 'client', 'contact-password-reseted', 'english', 'Password Reset - Confirmation', ' Tu contraseña ha sido cambiada', '<strong><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\">Has cambiado tu contrase&ntilde;a. </span></span><br /></strong><br /><span style=\"vertical-align: inherit;\">Por favor, gu&aacute;rdelo en sus registros para que no lo olvide. </span><br /><br /><span style=\"vertical-align: inherit;\">Su direcci&oacute;n de correo electr&oacute;nico para iniciar sesi&oacute;n es: {contact_email}</span><br /><br /><span style=\"vertical-align: inherit;\">Si no es usted, cont&aacute;ctenos. </span><br /><br /><span style=\"vertical-align: inherit;\">{firma de email}</span>', '{companyname} | CRM', '', 0, 1, 0),
(43, 'client', 'contact-set-password', 'english', 'Set New Password', 'Configure su nueva contraseña en {companyname} ', '<h2><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\">Configure su nueva contrase&ntilde;a en {companyname}</span></span></h2>\r\n<span style=\"vertical-align: inherit;\">Utilice el siguiente enlace para configurar su nueva contrase&ntilde;a: </span><br /><br /><a href=\"{set_password_url}\"><span style=\"vertical-align: inherit;\">Establecer nueva contrase&ntilde;a</span></a><br /><br /><span style=\"vertical-align: inherit;\"> Gu&aacute;rdela en sus registros para que no la olvide. </span><br /><br /><span style=\"vertical-align: inherit;\">Establezca su nueva contrase&ntilde;a en </span><strong><span style=\"vertical-align: inherit;\">48 horas</span></strong><span style=\"vertical-align: inherit;\"> . Despu&eacute;s de eso, no podr&aacute; establecer su contrase&ntilde;a porque este enlace caducar&aacute;. </span><br /><br /><span style=\"vertical-align: inherit;\">Puede iniciar sesi&oacute;n en: </span><a href=\"{crm_url}\"><span style=\"vertical-align: inherit;\">{crm_url}</span></a><br /><span style=\"vertical-align: inherit;\"> Su direcci&oacute;n de correo electr&oacute;nico para iniciar sesi&oacute;n: {contact_email} </span><br /><br /><span style=\"vertical-align: inherit;\">{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0),
(44, 'staff', 'staff-forgot-password', 'english', 'Forgot Password', ' Crear nueva contraseña', '<h2><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\">Crear una nueva contrase&ntilde;a</span></span></h2>\r\n<span style=\"vertical-align: inherit;\">&iquest;Olvidaste tu contrase&ntilde;a? </span><br /><span style=\"vertical-align: inherit;\">Para crear una nueva contrase&ntilde;a, simplemente siga este enlace: </span><br /><br /><a href=\"{reset_password_url}\"><span style=\"vertical-align: inherit;\">Restablecer contrase&ntilde;a</span></a><br /><br /><span style=\"vertical-align: inherit;\"> Recibi&oacute; este correo electr&oacute;nico porque lo solicit&oacute; un &nbsp;usuario de </span><strong><span style=\"vertical-align: inherit;\">{companyname} . </span></strong><span style=\"vertical-align: inherit;\">Esto es parte del procedimiento para crear una nueva contrase&ntilde;a en el sistema. Si NO solicit&oacute; una nueva contrase&ntilde;a, ignore este correo electr&oacute;nico y su contrase&ntilde;a seguir&aacute; siendo la misma. </span><br /><br /><span style=\"vertical-align: inherit;\">{firma de email}</span>', '{companyname} | CRM', '', 0, 1, 0),
