INSERT INTO `tbltemplates` (`id`, `name`, `type`, `addedfrom`, `content`) VALUES
(6, 'CONTRATO TERMINACION DE PROYECTO IQ', 'contracts', 5, '<h1><span style=\"font-size:10pt;\">CONVENIO DE TERMINACI&#211;N AL&#160; CONTRATO DE<u> TIENDA VIRTUAL</u> QUE CELEBRAN, POR UNA PARTE &#8220;IQNETING&#8221;, A LA QUE EN LO SUCESIVO SE LE DENOMINAR&#193; &#8220;EL PRESTADOR DE SERVICIOS&#8221;, REPRESENTADA EN ESTE ACTO POR<u> EL ING ALAN GUILLERMO MADRID</u> <u>ANAYA</u>; Y POR LA OTRA PARTE,<u> INTERTRAFICO </u>, AL QUE EN LO SUCESIVO SE LE DENOMINAR&#193; &#8220;<u> CLIENTE</u>&#8221;, REPRESENTADA EN ESTE ACTO POR <u>GERARDO MORALES TREJO, </u>CONFORME A LOS ANTECEDENTES Y CL&#193;USULAS SIGUIENTES:</span></h1>\n<p><span style=\"font-size:10pt;\"><strong>&#160;</strong></span></p>\n<p><strong>&#160;</strong></p>\n<p><strong>A N T E C E D E N T E S</strong></p>\n<p><strong>&#160;</strong></p>\n<ol><li>Que con fecha<u> 02 </u>de<u> febrero de 2022.&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; </u>, las partes suscribieron un Contrato de<u> prestaci&#243;n de servicios , </u>en lo sucesivo <strong>&#8220;EL CONTRATO&#8221;</strong>, con el objeto de<u> Tienda virtual </u>.</li>\n</ol><p>&#160;</p>\n<ol start=\"2\"><li>Que ambas partes reconocen mutuamente su personalidad jur&#237;dica y la de sus representantes legales.</li>\n</ol><p>&#160;</p>\n<ol start=\"3\"><li>Que ambas partes ratifican como sus domicilios legales los se&#241;alados en <strong>&#8220;EL CONTRATO&#8221;</strong>.</li>\n</ol><p>&#160;</p>\n<ol start=\"4\"><li>En la cl&#225;usula<u> novena </u>de <strong>\"EL CONTRATO\" </strong>se estableci&#243; que su duraci&#243;n ser&#237;a de<u> 30 d&#237;as </u>a partir de su firma. (Para que proceda la terminaci&#243;n anticipada debe estar vigente <strong>\"EL CONTRATO\"</strong>)</li>\n</ol><p>&#160;</p>\n<p>&#160;</p>\n<h1>C L &#193; U S U L A S</h1>\n<p><strong>&#160;</strong></p>\n<p><strong>&#160;</strong></p>\n<p><strong>PRIMERA.</strong></p>\n<p><strong>&#160;</strong></p>\n<p>El objeto del presente instrumento es dar por terminado <strong>&#8220;EL CONTRATO&#8221;</strong>.</p>\n<p>&#160;</p>\n<p>&#160;</p>\n<h1>SEGUNDA.</h1>\n<p><strong>&#160;</strong></p>\n<p>Que ambas artes est&#225;n conformes con las acciones y compromisos realizadas, hasta el momento de la celebraci&#243;n de <strong>\"EL CONTRATO\"</strong>.</p>\n<br><h1>TERCERA.</h1>\n<p>Las partes acuerdan que a la firma del presente instrumento se otorgan el m&#225;s amplio finiquito, no reserv&#225;ndose acci&#243;n o derecho alguno que ejercitar con posterioridad, sea por v&#237;a civil, penal o de cualquier otra &#237;ndole.</p>\n<p>&#160;</p>\n<p>&#160;</p>\n<h1>CUARTA.</h1>\n<p><strong>&#160;</strong></p>\n<p>El presente Convenio empezar&#225; a surtir sus efectos a partir de la fecha de su firma.</p>\n<p>&#160;</p>\n<p>&#160;</p>\n<p>Le&#237;do que fue el presente instrumento y enteradas las partes de su contenido y alcance, lo firman en la ciudad de M&#233;xico,&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; a los <u>&#160;</u><u>31&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; </u>d&#237;as del mes de <u>&#160;marzo </u>&#160;<u>de 2022.</u></p>\n<p>&#160;</p>\n<p>&#160;</p>'),
(7, 'Carta de devolución', 'contracts', 5, '<p>Ciudad de M&#233;xico a 30 de mayo de 2022</p>\n<p>&#160;</p>\n<p>Por medio de la presente hacemos constar que el proyecto de taquer&#237;a Sahuayo a nombre de Carlos Antonio Hern&#225;ndez Le&#243;n, como veredicto se tom&#243; la decisi&#243;n de hacer la devoluci&#243;n de su inversi&#243;n por la cantidad de $ 15, 080.00 (Quince mil ochenta pesos 00/100 M.N.) Iva Incluido, que ser&#225; efectuada a 60 d&#237;as.</p>\n<p>Contando a partir de esta fecha. La devoluci&#243;n se har&#225; por medio de transferencia bancaria a la siguiente cuenta:</p>\n<p>Banco BBVA Bancomer</p>\n<p>Clabe interbancaria: 012180029993723341</p>\n<p>A nombre de: Carlos Antonio Hern&#225;ndez Le&#243;n.</p>\n<p><strong>Su devoluci&#243;n se har&#225; el 1 agosto de 2022. </strong></p>\n<p>&#160;</p>\n<p>&#160;</p>\n<p>&#160;</p>\n<p>Acepto</p>\n<p>&#160;</p>\n<p>Taquer&#237;a Sahuayo</p>\n<p>Carlos Antonio Hern&#225;ndez Le&#243;n</p>\n<p>&#160;</p>\n<p>&#160;</p>\n<p>&#160;</p>\n<p>&#160;</p>'),
(9, 'CONTRATO DE PRESTACION DE SERVICIOS', 'contracts', 5, '<p style=\"text-align:center;\"><strong>CONTRATO DE PRESTACION DE SERVICIOS PROFESIONALES</strong></p>\n<p><strong>&#160;</strong>Que celebran por una primera parte La empresa<span>&#160;</span><strong>IQneting con domicilio fiscal en Montecito #38 Piso 28 Oficina 16, Colonia N&#225;poles, C.P. 03810</strong><strong>, Ciudad de M&#233;xico,<span>&#160;</span></strong>Prestadora de servicios de tecnolog&#237;as de la informaci&#243;n, para lo sucesivo del contrato se le denominar&#225; &#8220;<strong>El Proveedor</strong><strong>,</strong>&#8221; y por la otra&#160;&#8220;<span>Artemio cuesta Rojas</span><strong>&#8221;</strong><span>&#160;</span>en lo sucesivo se le denominar&#225;<span>&#160;</span><strong>&#8220;EL cliente</strong>&#8221; y los que &#160;en su conjunto se les denominar&#225;&#8221; las partes&#8221;, quienes se sujetan al tenor de las siguientes declaraciones y clausulas. ----------</p>\n<p><strong><u>DECLARACIONES</u></strong></p>\n<h4>I.- Declara &#8220;EL PROVEEDOR&#8221;</h4>\n<p>A)<span>&#160;</span><span>IQneting (Prestadora de servicios en tecnolog&#237;as de la informaci&#243;n Ubicada&#160;<strong>Montecito #38 Piso 28 Oficina 16, Colonia N&#225;poles, C.P. 03810. Ciudad de M&#233;xico.</strong></span></p>\n<p>B) Que cuenta con la capacidad legal experiencia, equipo y personal necesario para llevar a cabo la elaboraci&#243;n y desarrollo que &#8220;el cliente&#8221; le va a encomendar y que es objeto materia del presente contrato.C) Que le ha proporcionado a &#8220;el cliente&#8221; una cotizaci&#243;n explicativa en qu&#233; consistir&#225; el objeto de este contrato, el cual se agrega como anexo al presente ---------------------------------------------D) Que le ha informado a &#8220;el cliente&#8221; que su obligaci&#243;n bajo el presente contrato es una obligaci&#243;n de medios y ---------------------------------------------------------------------------------------------------</p>\n<h4>II. DECLARA EL CLIENTE</h4>\n<p>A). &#8211;<span>&#160;</span><span>Artemio Cuesta Rojas</span><strong>&#160;</strong>Ser una persona Fisica con RFC&#160;<span>&#160;</span><b>XAXX010101000<span>&#160;</span></b><span>&#160;</span>, con domicilio fiscal en ,&#160; In<span><em>surgentes</em>&#160;#33 esquina con Boca Negra , Huajuapan de Le&#243;n, Oaxaca.</span></p>\n<p>B). - Que Requiere la asistencia tecnol&#243;gica para la implementaci&#243;n de&#160; una Tienda Virtual ------------------------------- - ------------------------------------------------------------------------------------------------</p>\n<p>C). - Que ha recibido una Propuesta por parte de<span>&#160;</span><strong>&#8220;EL PROVEEDOR&#8221;<span>&#160;</span></strong>para la, arquitectura de la plataforma, denominada &#8220; TIenda Virtual&#8221; el cual se agrega como anexo al presente contrato. -------------------------------------------------------------------------------</p>\n<p></p>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong>III.- DECLARAN \"LAS PARTES&#8221;:<span>&#160;</span></strong>Que han celebrado pl&#225;ticas durante las cuales han manifestado su mutuo inter&#233;s &#8220;el proveedor&#8221; en prestar sus servicios profesionales y &#8220;el cliente&#8221; en recibirlos y estar conforme con la<span>&#160;</span><strong>COTIZACI&#211;N DE HONORARIOS Y GASTOS,<span>&#160;</span></strong>por lo que celebra el presente contrato y se obligan a sujetarse a las siguientes: -----------------------------------------------------------------</p>\n<p>-------------</p>\n<h3>OBJETO DEL CONTRATO</h3>\n<p><strong>&#160;</strong><strong>PRIMERA. -<span>&#160;</span></strong><strong>Objeto del Contrato. - &#8220;EL PROVEEDOR&#8221;<span>&#160;</span></strong>se obliga frente a &#8220;el cliente&#8221; a realizar los siguientes servicios profesionales consistentes en el desarrollo, arquitectura de la plataforma denominada &#8220;Tienda Virtual&#8221; y que cuenta con la certificaci&#243;n necesaria, los conocimientos, m&#233;todos tecnol&#243;gicos, experiencia y capacidad suficiente paras entregar terminada y funcionando al 100/100 para dar por materializado el presente contrato. ------------------------------------------------</p>\n<p><strong>&#8220;EL PROVEEDOR&#8221;<span>&#160;</span></strong>se obliga a poner toda su experiencia, conocimiento y personal con el conocimiento t&#233;cnico, as&#237; como actuar con diligencia en todo momento en la solicitud que &#8220;el cliente&#8221; le encomienda bajo el presente contrato. ---------------------------------------------------------------------------------------------------------------------&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160;&#160;</p>\n<p><strong>SEGUNDA. - Honorarios y forma de pago. -<span>&#160;</span></strong>&#8220;el cliente&#8221; por los servicios profesionales se obliga a pagar por concepto de honorarios profesionales a &#8220;el proveedor&#8221; los establecido en este acto que es de $<span>&#160;</span><strong>23,200.00 (Veinti tres mil doscientos pesos 00/100 M.N.) IVA incluido. Que ser&#225;n pagados de la siguiente forma:</strong><strong></strong></p>\n<p><strong>$ 14,000.00 (catorce mil pesos 00/100 M.N.) que ser&#225;n pagado a la firma de este contrato y los $ 9,200.00 (nueve mil doscientos pesos 00/100 M.N.) seran en pagos diferidos hasta el termino del proyecto.&#160;</strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong>&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160;</strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong>Tercera.- Obligaciones de &#8220;PROVEEDOR&#8221;<span>&#160;</span></strong><span>Bajo el presente contrato est&#225; obligado frente a &#8220;el cliente&#8221; a:&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160;</span></p>\n<p>A) Desarrollar todos los medios necesarios para la obtenci&#243;n de una plataforma funcional para el clienteB) Ceder&#225; todos los derechos que por s&#237; mismos correspondan conforme a derecho a &#8220;EL CLIENTE&#8221;</p>\n<p>A). - Ser informado completa y verazmente de todas las circunstancias relativas al el desarrollo de la encomienda.</p>\n<p>B). -A qu&#233; se le entregue en tiempo y forma toda la documentaci&#243;n legal e informaci&#243;n que soporte la plataforma, as&#237; como hacer entrega de credenciales de servidores y cuentas GitHub, con su respectivo c&#243;digo fuente.</p>\n<p>C) .-<span>&#160;</span><span><strong>El tiempo de entrega.es de 30 d&#237;as</strong>&#160;</span></p>\n<p><strong>&#160;</strong><strong>CUARTA. - Derechos &#8220;</strong><strong>EL PROVEEDOR&#8221;,<span>&#160;</span></strong>bajo el presente contrato ser&#225; su derecho&#160;</p>\n<p><strong>1.-<span>&#160;</span></strong>A cobrar en tiempo y forma los honorarios pactados en el presente contrato. -------------------</p>\n<p><strong>QUINTA.</strong>-<span>&#160;</span><strong>Obligaciones de &#8220;el cliente&#8221;</strong>. - bajo el presente contrato el cliente tiene las</p>\n<p>Siguientes obligaciones para con &#8220;el proveedor&#8221;: ---------------------------------------------------------- A). - A pagar oportunamente los honorarios pactados en el presente contrato. ----------------------</p>\n<p>B). - A informar a &#8220;El proveedor&#8221; de todas las particularidades y caracter&#237;sticas que vallan sugiriendo para el perfeccionamiento de la plataforma encomendada----------------------</p>\n<p>C). - A entregar la documentaci&#243;n que soporte el asunto a &#8220;El proveedor&#8221; en forma oportuna para evitar atrasos por parte de &#8220;el proveedor&#8221;</p>\n<p>&#160;</p>\n<p><strong>SEXTA.- Derechos de &#8220;el cliente&#8221;<span>&#160;</span></strong>bajo el presente contrato &#8220;el cliente&#8221; tiene derecho.---------------<br>I).-<span>&#160;</span><strong>A ser informado del avance de su plataforma</strong>.----------------------------------------------------<br>II). - A obtener recibo de honorarios o factura por las cantidades pagadas a &#8220;el proveedor&#8221;. ---------------<br>III). -A tener la documentaci&#243;n de todo tr&#225;mite efectuado por el desarrollo y alojamiento ante las empresas correspondientes----------<br>IV). -&#160; Estar informado puntualmente y tener una excelente comunicaci&#243;n con el personal a cargo del proyecto que &#8220;el proveedor asigne&#8221;<strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong></strong></p>\n<p><strong>SEPTIMA.- Naturaleza civil del contrato.<span>&#160;</span></strong>Las partes saben que la naturaleza del presente contrato es civil y que est&#225; regulado por las disposiciones contenidas en el C&#243;digo Civil para Ciudad de M&#233;xico. Las partes saben que entre &#8220;El proveedor&#8221; y &#8220;el cliente&#8221; solo existe una prestaci&#243;n de servicios profesionales entre particulares. ---------------------------------------------------</p>\n<p><strong>OCTAVA. - Exclusividad de &#8220;El PROVEEDOR&#8221;.<span>&#160;</span></strong>Las partes&#8221;<span>&#160;</span><strong>saben que &#8220;El PROVEEDOR&#8221; no trabajar&#225;<span>&#160;</span></strong>en forma exclusiva para<span>&#160;</span><strong>&#8220;el cliente&#8221;</strong><span>&#160;</span>ya que es un modelo de negocio gen&#233;rico. Exceptuando en materia t&#233;cnica que durante el desarrollo del objeto del presente contrato no podr&#225; desarrollar otra plataforma, igual o del mismo tipo mientras no termine la encomienda contenida en este contrato por &#8220;el cliente&#8221;. -</p>\n<p>&#160;<strong>NOVENA.- DURACI&#211;N DEL CONTRATO<span>&#160;</span></strong>El presente contrato tendr&#225; una duraci&#243;n hasta de<span>&#160;</span><strong>30 d&#237;as h&#225;biles</strong><span>&#160;</span>para la terminaci&#243;n en su totalidad del objeto que da vida al presente contrato. Por lo que posteriormente se le otorgara al cliente una garant&#237;a postventa de 60 d&#237;as por bugs de programaci&#243;n------------------------------</p>\n<p>&#160;<strong>DECIMA. Modificaciones.<span>&#160;</span></strong>Las partes acuerdan que cualquier modificaci&#243;n al presente contrato debe constar por escrito y estar firmada por las partes.----------------------------------------------------</p>\n<p><strong>DECIMA PRIMERA &#8220;EL PROVEEDOR&#8221;.<span>&#160;</span></strong>Se obliga y compromete con<span>&#160;</span><strong>&#8220;EL CLIENTE</strong><span>&#160;</span>&#8220;a responder por el saneamiento respectivo para el caso de evicci&#243;n en los t&#233;rminos del art&#237;culo 2311 del C&#243;digo Civil Vigente en el Estado. -------------------------------------------------------------------------------------------------</p>\n<p><strong>DECIMA SEGUNDA.<span>&#160;</span><span>En caso de cancelaci&#243;n por inconformidad,incumplimiento o alguna variante,&#160; el cliente sera penalizado por parte de Iqneting ( proveedor) con el 40% del costo del proyecto. que ser&#225;n pagados en un plazo no mayor a 90 d&#237;as.</span></strong></p>\n<p><strong>DECIMA&#160; TERCERA- Jurisdicci&#243;n Y Competencia;<span>&#160;</span></strong>Para todo lo relativo a la interpretaci&#243;n y cumplimiento del presente contrato, ambas partes se someten expresamente al fuero de las leyes de la Ciudad de M&#233;xico, renunciando expresamente al fuero que por su domicilio presente o futuro les pudiere corresponder, por lo que las partes firmaron el presente contrato sin estar afectada su voluntad por dolo, error, mala fe o violencia, en la Ciudad de M&#233;xico,&#160; el d&#237;a 15&#160; de julio de 2022.</p>');
